C.yG=H.b(s(["Food insecurity is an issue that affects 1 in 8 Americans. Due to this, many food banks are often struggling with food collection and distribution. To make matters more difficult, many of these individuals do not qualify for federal nutrition programs currently and thus rely heavily on their local food banks. This is all happening in a country where 30-40% of food goes to waste. A large portion of this waste is simply due to the food being \u201cugly.\u201d This ranges from dents in cans to off-color tomatoes. These items, along with those around after the suggested sell-by date, are often still safe to donate, yet aren\u2019t donated.","A group of college students and I developed the Community Food app working together with restaurants, grocers, and food banks to connect people to better food. Our app makes listing donations and scheduling food pickups as easy as a few taps.","Our team had researched reasons restaurants and grocers are not donating food and discovered the following three main reasons.","1. Lack of Education. Many workers do not possess knowledge of their local food resources and do not know how to responsibly donate.","2. Hassle/Lack of Time. Often, restaurants and grocers feel as though it is too difficult to comprise a list of necessary items and contact the local food resource. Donations are not prioritized because of the commotion and amount of other tasks to be completed in kitchens and supply rooms.","3. Assumption that the food is unwanted. This is similar to the lack of education but is based around the idea that the food will not be acceptable for the food resource and thus better in the trash.","One of the biggest factors we found when conducting our research was that no one said they do not donate because they have nothing to give or no one to give it to; they simply just did not know what to give or who would be the best recipient.","We aimed to help solve the issue of food insecurity and food waste in one elegant solution. Education and automation of the food donation and receiving process will help us tackle these issues head-on."]),t.i)
C.z9=H.b(s(["Our team realized that the gap between the 40% of food going to waste and the 1 in 8 food-insecure Americans was not a supply problem but a data problem. We started looking at how we could help automate the food donation and collection process to encourage donations while at the same time educating the public. This was the founding idea for the Community Food app.","Looking at the current donation process, individuals are expected to search for their local food resource, give the location a call, and then wait to describe their possible donation to an overworked volunteer. It is not an easy or rewarding process, and poor descriptions lead to wasted time.","As a donor, all one would have to do is download the app, register their location, and start scanning barcodes of items ready to be sent to food services, along with a brief description. At this point, the volunteers at the local food services will be alerted on their phones that there is food ready to be retrieved. They will get information on the type of food, its nutritional content, its size, and perishability. This will allow volunteers to make educated decisions on how much room they need, how many volunteers should go out, and if they need to bring a refrigeration unit. This will help keep food from spoiling, as well as save the time of overworked volunteers.","This application takes advantage of the fact that most people have a smartphone with access to the internet, GPS, and a camera on them at all times. We take the average smartphone and turn it into a network of data collection devices in the fight against hunger.","Community Food takes away the need to know who and where one is donating to. In addition, the app removes the hassle of logging and communication, and most importantly, Community Food shares exact nutrients and sizing information with the volunteers picking it up. This makes everyone\u2019s lives easier in the food donation and collection process."]),t.i)
C.ye=H.b(s(["Food Donation","communityfood.png","comfood2.png","comfood3.png","Community Food",C.yG,C.z9,"Scanning a barcode in the app","Securely signing into the system","See it on the Play Store","https://play.google.com/store/apps/details?id=com.certainlyapps.community_food",4294220075]),t.b)
C.ys=H.b(s(["Way in the back of the campus at the Rochester Institute of Technology is a beige paneled building. Most of the space on the ground floor is taken up by a laundry room, but next to that is a FoodShare. This is a place for students in need to pick up donated groceries and other essentials donated from the local community.","For the first 2 years of college, I thought nothing of it until a friend mentioned to me that it had well over 8,000 student visits. For a private college with clubs giving away free food and vendors offering samples, I always took food for granted. This was clearly not the case for everyone.","I started Campus Food as a Twitter retweet bot and a way to start learning Python. This account would search for tweets mentioning free food at RIT and retweet them to the @RITFreeFood account for my followers. After setting it up I quickly forgot about it, thinking little of the efforts so far. A year later, I revisited the page and noticed the 500+ followers and the many missed messages. I never anticipated such a large response.","I then realized there may be some potential to this idea. Many of the messages were about bringing this account to other platforms besides Twitter, which was quickly losing popularity on campus. I started work on an RITFreeFood website where students could view a live map of free food powered by location keywords in the tweets. From there I added a method for students to submit new events directly to the service. This is when I had a few brands reach out to me wanting to promote their products."]),t.i)
C.yl=H.b(s(["I decided to make the pivot from a fairly basic webpage to a mobile application. This was due in large part from not knowing how to properly store my API keys in JavaScript. I wrote and released a mobile application, now called Campus Food, on iOS and Android. This quickly grew minor popularity on campus.","My goal from there was to implement ads and collaborate with brands doing events on campus to promote their giveaways in order to start making revenue. I recruited a small team of students to grow this idea with me.","The following semester, we launched a crowdfunding campaign to scale our app to new campuses. Currently, the app is functional on over 800 campuses in the United States, helping hungry people find free food and reducing food waste."]),t.i)
C.yf=H.b(s(["Finding Free Food","campusfood.png","campusfood3.png","campusfood2.png","Campus Food",C.ys,C.yl,"The login screen of the app","An example of a post on the app","See it on the Play Store","https://play.google.com/store/apps/details?id=com.certainly_apps.campus_food",4293357950]),t.b)
C.zi=H.b(s(["Eyeglasses should be a form of expression. What if instead of selecting from a limited set of cookie-cutter eyewear, you could have fully customized glasses? What if you could do this all from the comfort of your home? This was the idea behind an entrepreneurial project I worked on in my sophomore year of college.","Working with a small team in a makerspace, we designed a way to quickly capture eye measurements from a standard smartphone selfie camera. With this data, we could manipulate standard eyeglass forms to guarantee superior fit.","Our ability to make custom glasses was enabled by using wood laminate and polycarbonate blanks cut out on an industrial laser cutter. This let us gain full control of each measurement and curve of the frames. From there, my team envisioned a system where a user could fully design their own styles. For customization, the sky was the limit!"]),t.i)
C.ym=H.b(s(["This project got accepted into the RIT Summer Start incubator, my college\u2019s exclusive student incubator. With the funding they provided my team, we spent the summer conducting market research and advancing our concept. Classes focused around competition analysis, prototype validation, analyzing growth financials, and developing our pitching skills.","In the 13 weeks of the program Form Eyewear transformed from a simple way to customize eyeglass styles into a form-fitting program for customers who want a truly custom fit. Summer Start was a great experience to rapidly iterate on an idea with other entrepreneurs in a similar stage of development."]),t.i)
C.yq=H.b(s(["Eyeglass Buying","form.png","fe3.png","fe2.png","Form Eyewear",C.zi,C.ym,"The features of a pair of Form Eyewear sunglasses","Custom defined measurements","","",4285357894]),t.b)
C.yh=H.b(s(["A common problem I believe in is that technology is advancing far faster than our education system. Teachers, though experienced in many fields, are continuously asked to prepare modern lessons without the support of the appropriate budget or time to learn themselves. For this reason, many modern engineering subjects are simply unable to be taught outside of a specialized environment. I was lucky enough to go to a high school that did offer these specialized engineering environments, and I wanted to bring this modern opportunity to the general population.","If we brought down the cost of materials and improved the learning curve for the instructor, most of the barriers to entry for this critical education could be eliminated. Currently, for $60 an instructor can demo basic electronics and circuitry lessons to a class. This is the cost of one kit, a kit that only one individual can interact with at a time. For this project, I wanted to offer that same learning experience to an entire class at the same time, all while not increasing the cost.","My solution to this problem: paper, easily the most common classroom material there is."]),t.i)
C.yL=H.b(s(["Paper Bread was an interactive online circuit maker where teachers could build their own, or download pre-built lesson plans for circuits. The circuit components listed in the lesson plans were real prototyping components such as breadboards, LEDs, SMD resistors, and various sensors. Most lesson plans had a cost per student of $2 ($60 for a class of 30 \ud83c\udf89) and included links to purchase the components wholesale.","Lesson plans were printed and placed on top of each breadboard. The students would then be instructed to punch each component through the paper and into the breadboard to complete the circuit. This design resembled the functions of the Lite-Brite toy.","I tested this project at Imagine RIT and two Maker Faires, helping people from 8 to 80 years old make their first circuit. The look of excitement when they lit up their first LED or connected their first sensor felt as though they had just performed magic. In under 10 minutes, participants went from a printed sheet of paper on a plastic box to controlling electricity using real electronics.","I am currently working on making a more stable version of this project and testing it in more classrooms. If you are interested in testing it out or finding out more, please feel free to reach out to me: McCossum@gmail.com"]),t.i)
C.yu=H.b(s(["Learning Electronics","paperbread.png","pb2.png","pb3.png","Paper Breadboarding",C.yh,C.yL,"A Parer Bread kit cut out","A young student using Paper Bread","","",4286207800]),t.b)
C.yz=H.b(s(["Finding new applications for existing products is just as important to the entrepreneurial mindset as creating a new product. Doing this not only provides new value to an existing product but greatly reduces the expensive development time. This is the approach I took with many of the applications in my portfolio.","It started simply, developing Campus Food in order to help the many hungry college students locate free food. To develop this application, my team had to create a system to aggregate and display live, crowdsourced geolocation data. This system served a much more friendly utility, but in short, that is all it was. After running the service for a few months a local food bank reached out to me thinking they were the intended audience. After taking the lesson to better brand the application I realized that they were not wrong, there was nothing preventing them from being the customer of a food geolocation aggregation service. My team and I quickly threw a new skin on the application and rebranded that fork as Community Food for them.","The move to create Campus Food took months but the transition to Community Food only took a few weeks. At this point, it had become easier to develop new applications for new markets instead of trying to add increasingly complex features to obtain a niche market. My team, at the time, split into one group working on new markets and the other group maintaining and marketing the already developed apps. This is when we created Upkeep Alert.","Moving from community-centered food information into facilities management systems was not an immediately apparent decision. The team took a long look at what location data we could crowdsource. I remember being on my way to a college exam and needing to quickly use the restroom. The sink in the restroom was stuck and overflowing, wasting a ton of water and damaging the area. I did nothing about this, as my exam felt more important to me than taking time to call maintenance. Due to not having a system to quickly send urgent maintenance requests, the expenses from these events piled up. This is where the idea for Upkeep Alert came from."]),t.i)
C.yg=H.b(s(["The process at the time for maintenance reporting was to observe a maintenance issue, find a computer, log in to an online portal, and try to describe an issue you are no longer even keeping an eye on. By using the same system as the other applications, all someone would have to do moving forward is take a picture on their phone and provide an optional description, and the geolocation data would be sent right to maintenance. The multi-step process was reduced to just 2 quick actions.","Due to the criticality of the data being captured by the app, my team created a unique strategy of rolling out changes. We would test new features in Campus Food, an app that if it failed, a few college students may miss out on a free food event. From there we tested them in a more critical application, Community Food. If all went well we would finally roll out the changes to Upkeep Alert, keeping our potential enterprise customers on the most stable and tested application.","We look to one day pick up this application\u2019s development again and integrate its simple reporting system into other commonly used maintenance management applications."]),t.i)
C.y5=H.b(s(["Maintenance Requests","ua3.png","upkeepalert.png","ua2.png","Upkeep Alert",C.yz,C.yg,"Marking a maintenance issue on the app","Providing more information on a maintenance issue","","",4279989187]),t.b)
C.yr=H.b(s(["It is my strong belief that some people do not deserve the fame the media gives them. News organizations fixate over the actions of evil individuals instead of the life stories of those affected. It is all too common that those who commit crimes are more remembered than the victims. Committing heinous acts should not be a means to fame, publicity, or anything positive.","I grew up in the digital age. From the time I entered high school, I started receiving my news not just from mainstream cable providers but from then-smaller indie productions such as the Philip DeFranco Show. This show was unique to me because of its bootstrap production setup and the show\u2019s ability to challenge the cookie-cutter model of broadcast news networks. The Philip DeFranco Show implemented a policy of not displaying or even naming individuals accused of monstrous acts. This was the first time I had seen a news organization have a policy like this and it greatly appealed to me.","Taking the idea from the show, I wanted to attempt to bring this approach to the rest of the internet. What came of this was NoFame, an optional Chrome plugin to remove the names of monsters from web pages. No longer would users have to constantly be surrounded by the names and life stories of school shooters, mass murderers, and other vile people; instead, it would replace their name with what they truly are, \u201ca monster.\u201d"]),t.i)
C.yJ=H.b(s(["Though this plugin will never be able to replace all mentions of monsters, I do try to keep up with lists supplied from well-reviewed Wikipedia lists. Admittedly, there are also a number of problems with the plugin being unable to appropriately remove common names and pictures of these people. I recognize these current shortcomings and do want to continue to improve the tool. If you believe you have a well-reviewed Wikipedia page that should be included in our list, please add it with the form here: https://bit.ly/2EHdsH6. With your help, we can make evil a fameless pursuit.","For more information as well as access to the plugin please visit this link or search \u201cNoFame\u201d in the Chrome WebStore."]),t.i)
C.yd=H.b(s(["Infamy","nofame.png","nofame.png","nofame.png","NoFame",C.yr,C.yJ,"NoFame logo","NoFame logo","See it on the Chrome Web Store","https://chrome.google.com/webstore/detail/nofame/fjjggbeocpjmkmfhlbggbbfehnkdcblp?hl=en-US",4284900966]),t.b)
C.yb=H.b(s(["During my second year of college, I was asked the question, \u201cWhat are our shortcomings when it comes to innovation?\u201d I had recently started leading the Innovator\u2019s Hour research organization through the Albert J. Simone Center for Innovation and Entrepreneurship. This  gave my team the unique opportunity to create programs to help address these shortcomings.","A few select members of the research organization and I realized that most of the entrepreneurial ideas coming from the club were targeted towards what we then called the \u201ciPhone Demographic.\u201d This largely upper-middle-class demographic usually consists of white, predominantly male, able-bodied individuals. There are many reasons for selecting this demographic when doing case studies for new products and services, but an immense portion of the population remains ignored.","On behalf of the club, I reached out to a number of diversity, inclusion, and belonging groups on the RIT campus. We ended up partnering with Grey Matter, a hot-button discussion group, along with the Center for Diversity and RIT\u2019s President\u2019s office to plan a weekend-long event named \u201cDesign for Diversity.\u201d","Design for Diversity challenged the students to design a product or service benefiting those in underrepresented groups. Teams of students were assigned pre-written user stories focusing on the lives of immigrants, specially-abled individuals, and various marginalized populations."]),t.i)
C.yQ=H.b(s(["From there, the teams examined what popular modern products were not serving these demographics and worked to identify why. The list the teams created was even larger than I expected.","The teams were then given the next 24 hours to reimagine popular products to better address the needs of their given user story. Innovator\u2019s Hour recruited a number of faculty moderators to advise the teams, making sure topics stayed respectful, appropriate, and unbiased toward negative stereotypes or assumptions. Many of the mentors even included individuals whose life experiences paralleled those of the user stories, gaining real market research in the process.","At the end of the weekend, the teams regrouped to present their work. Though none of these ideas ever came to market, the goal of this event was still achieved. It was never our intention to sell a new product or service from this weekend but instead, we wanted students thinking outside the illegitimate box of the perception of a \u201cnormal\u201d end-user. We hope this activity inspired more diverse work in the RIT entrepreneurship community moving forward."]),t.i)
C.zb=H.b(s(["Disability Design Thinking","desfordiv.png","ih2.png","ih3.png","Design For Diversity",C.yb,C.yQ,"Students brainstorming","Students presenting their final project","","",4291110187]),t.b)
C.yi=H.b(s(["Coffee grounds and rubber balloons. These are everyday items that most people may have lying around their house. They are fairly cheap and can help put together a good party but what if they could also work as a decent universal grabber for those without full dexterity?","By filling a common latex balloon with coffee grounds, or another fine ground yet unevenly sized material, and applying a vacuum, it will tightly form around whatever object it is pressed against. The granular material will go from acting more like a liquid to acting as a rigid solid. Along with this, the latex balloon will create a fair bit of friction, allowing for it to grab even obtuse angles.","This idea is already used in a few industrial applications for picking up and placing objects of non-standard geometry. Experimenting with this idea in college I wanted to see if I could create one of these devices to pick up things in my dormitory and how small I could make it. After playing around with it for a while I realized there may be potential to help people with low dexterity pick up objects. Using a balloon was a lot easier than using one of those claw arms used by people who cannot bend over and it can pick up a wider range of objects. Creating a grabbing-wand would certainly be one way to take this project, but I also found the idea of making a palm-sized device quite interesting. Having this device in the palm of your hand would allow people with limited or no mobility in their hands to still pick up small objects with ease. The best part was that the materials were mostly household items already and the cost would be fairly low."]),t.i)
C.zh=H.b(s(["Areas where this design falls short are, first and foremost, around the fact that this device does not look like a traditional hand. There is an immense amount of work trying to create prosthetics that look similar to a human hand. This is completely understandable, as there is a strong stigma around having an artificial part of your body. This design simply does not take this into account at this time. Also, the vacuum needed in this design is quite powerful, though there are some improvements that could greatly scale this down in a closed system. Along with this, the current model is quite bulky and complex. It puts functionality and versatility above aesthetics and simplicity. There are also concerns with the current model\u2019s durability over time. Luckily, the parts most likely to need replacement are some of the cheapest currently.","I would greatly enjoy being able to test these designs further in real-world situations. There are plenty of areas for improvement but the idea still stands- there must be a cost-effective way to provide versatile prosthetics to those in need."]),t.i)
C.yM=H.b(s(["Low-Mobility Dexterity","hand.png","joe2.png","joe3.png","Joe Universal Grip",C.yi,C.zh,"Coffee grounds acting solid when compacted","Sketch of internal components","","",4290492856]),t.b)
C.yp=H.b(s(["Growing up in the Pacific Northwest bikes were everywhere, and that also meant plenty of bike racks. I remember as a kid jumping between the loops of the wavy, curbside racks thinking I looked pretty cool. As I grew up, unfortunately, they became more of a nuisance. They narrowed packed sidewalks and collected politically-charged stickers, yet they still served a great public use.","It was these thoughts I brought in when I began my high school Engineering Design class. In this class, we had to pick a real-world problem and investigate potential solutions over the course of a full year. This class was the first time I was asked to apply engineering and design-thinking to a real-world problem.","My team, involving my best friend, a random classmate, and of course myself, chose to tackle the mild nuisance of bike racks. We wanted to find a solution that would still allow us to have as many bike racks as desired while removing them from cluttering pathways while not in use. For this, we created the idea of folding bike racks."]),t.i)
C.yw=H.b(s(["Folding bike racks would allow them to be placed flush with the pathway when not in use. This would keep the racks from acting as fences when not in use. Of course, this created a fair bit of new problems. How would it safely lock into place when in use? How would the racks not trip people, and what about the hole they left behind when in use?","To answer these questions and quickly demonstrate solutions, we learned basic AutoCAD. This allowed us to come up with solutions for vertically sliding racks or smaller post-style racks. This was the first time I had gone through a design-thinking approach for a project, and I learned a lot about iterative solutioning in engineering. "]),t.i)
C.yv=H.b(s(["Bike Racks","rack.png","rack3.png","rack2.png","Hidden Bike Racks",C.yp,C.yw,"Early prototype of the folding bike rack","Render of the folding bike rack\n(Sliding version in round picture above)","","",4282874563]),t.b)
C.yN=H.b(s(["Imagine cooking mac and cheese while babysitting. Everything is going great, the kid is off in the other room cleaning up after playing with some toys when they trip and fall. They are crying for help and you quickly go over to comfort them. Simple bruises and accidents are a not too uncommon event while babysitting, but how do we know when they occur? Simple- we hear them crying for help.","Now imagine you are staying at a friend\u2019s house for the weekend. If the doorbell rings or the fire alarm gets tripped, you should most likely do something about it, and many of us do.","Now imagine both these situations but you are Hard of Hearing or Deaf. In these situations seconds are precious, yet the barrier to be called to action can be immense. This was the founding idea behind Wavio, an intelligent sounds recognition startup I joined during my third year of college.","Wavio is a fully integrated notification platform deployed through plug-and-play sound recognition technology capitalizing on proprietary audio signal processing algorithms delivering a unique user experience. In short, it would plug into the wall, listen for critical sounds, and notify the user on their smartphone."]),t.i)
C.y1=H.b(s(["The Wavio device aimed to remove critical barriers faced by the Deaf and Hard of Hearing community. The team was led by members who had experienced many of the current difficulties associated with being Hard of Hearing, including an experience very similar to the first example above. With their insight, they were able to lead a highly-motivated engineering team to develop a product to remove barriers and take advantage of emerging technology solutions.","While working with the Wavio team, I gained experience taking a product from conceptual designs through market validation and manufacturing negotiations. I learned about PCB layout, design for manufacturability, and most importantly, perspectives from a customer segment I was largely unfamiliar with. "]),t.i)
C.yy=H.b(s(["Hearing","wavio1.png","wavio3.png","wavio2.png","Wavio",C.yN,C.y1,"Wavio device concepts","A Wavio prototype plugged into a wall","See how the project advanced: see-sound.com","https://www.see-sound.com/",4280655359]),t.b)
C.zd=H.b(s(["Have you ever had the frustrating experience of wanting to go out and eat with someone but you just can\u2019t agree as to where? For people who want to quickly and collaboratively choose where to eat, I created Restaurant Match. This is an app where you and your party can swipe through places to eat around you and get notified when you match.","Think Tinder, but for restaurants.","With the app, you can swipe through all the eateries local to your area in privacy. This allows you to choose as many places as you feel comfortable going without having to justify each decision one-by-one. While you are looking for places, your party can do the same. As soon as there are a few matches, you and your party will be alerted. This allows for a short, already agreed-upon list to be vetted instead of a lengthy list of controversial food choices."]),t.i)
C.ya=H.b(s(["This application was developed with Flutter/Dart. It uses the Google Places API along with the Google Maps Mobile SDK and a few other support libraries for Flutter to produce a rich restaurant mapping experience. This can provide filtering information such as distance, rating, and price.","This application is still in development, as there are a number of hurdles yet to overcome, such as developing certain aspects and polishing up the experience overall. I did plan on releasing a beta version of this app in March 2020, but that was a very unfortunate time to develop an application based around restaurants and going places in general. I still cannot justify releasing the beta but hope to further the development of this soon. "]),t.i)
C.z7=H.b(s(["Picking Where to Eat","rm.png","rm2.png","rm3.png","Restaurant Match",C.zd,C.ya,"Getting location within the app","Example of a card within the app","","",4283020262]),t.b)
C.yc=H.b(s(["In my final year of college, I had the privilege of taking the Functional Printing special topics class in the AMPrint Center. This was conducted in the NY State Center for Advanced Technology funded Center for Additive Manufacturing and Multifunctional Printing. All the long names made the class feel very official.","In the class we studied an immense amount of printing styles, from Flexo to Gravure and Stereolithography to Fused Deposition Modeling. Throughout the entirety of college, no class made my head hurt more. It was incredible to see all the various solutions to printing and additive manufacturing processes, but this class was not just for demonstrating existing methods. For our grade in the class we had to use a combination of the printing methods in a new way. This meant either creating a new end-product using the tools or combining the printing methods in a new way.","My team took on trying to create a Peltier tile on a flexible substrate. The main goal of the project was to create a printed, flexible Peltier device that could produce small amounts of current through the Seebeck effect when a temperature gradient was applied on either side. Peltier devices had, up to this point, traditionally been made of rigid ceramic in order to withstand their temperature gradients. This increases their durability but prevents them from properly conforming to irregular surface areas. ","The potential for a flexible Peltier device could open the door to possibilities of thermal power generation in wearable technology. With further research, it is feasible that fabric-like material could generate small amounts of energy with the temperature gradient between the body and the ambient room temperature. This would open the door for the continuous recharging of wearable tech. Above all this, the flexible and patterned method for creating these devices could allow for roll-to-roll processing of these devices, allowing for variable sizes and an overall reduction in manufacturing cost."]),t.i)
C.zj=H.b(s(["All major parts of the Peltier device have been commonly printed for other drives. This includes flexible copper, printed solder, and both P and N type semiconductors. By printing flexible copper traces into a flexible yet heat resistant substrate such as Kapton and depositing P and N type printable semiconductors like PEDOT:PSS, a flexible Peltier device is theoretically possible.","A basic Peltier tile functions with an insulating air gap between components, allowing for an increased temperature gradient. With the appropriate printing methods, we can replace this with a flexible silicone insulator to further enhance the effects. This could also allow for smaller material deposition sizes by using the ceramic to place the semiconductors more precisely. By having everything more compact, the device would be much more efficient at generating current.","During the course of the semester, our tested printed Peltier device did not show conclusive results. This could have been due to the limited number of semiconductor junctions or large impurities in our printing processes. We also did not have access to the printable semiconductor material we had first envisioned with the design. More research would have to be done in order to find a more efficient process for creating this device."]),t.i)
C.yK=H.b(s(["3D Printed Power Generation","pt1.png","pt3.png","pt2.png","Flexible 3D Printed Peltier Tiles",C.yc,C.zj,"Assembling layers of printed components","Testing of an early prototype","","",4294609154]),t.b)
C.yj=H.b(s(["# **Current Concepts**","## **Background**","The recent rise in Non Fungible Tokens (NFTs) has shown a modern resurgence in the classic collectable market. NFTs expand on the established fungible token trading markets such as Ethereum and Bitcoin by adding a unique characteristic to each item.","Millions of NFTs have been created and traded in the first few months of 2020. One of the most notable NFTs is CryptoPunks, a set of pixelated headshots creating a total trade volume of $259.03M. This set of tradable tokens is capped at 10,000 total unique images. Each one allows for a subjective value to be assigned to them in the eyes of the market. This subjective value is the driving force behind the rise of NFTs and many cryptocurrencies. These assets, untied to any physical value, are purely distilled to their tradable value.","## **The Finite**","The CryptoPunks set is innately finite. This sets a scarcity demand that creates economic stability for Cryptopunks and other similar NFTS, not unlike how the gold standard created stability for the U.S. dollar. Due to the limited set of CryptoPunks some traders aim on collecting like sets, thus inflating the value of their investment for future trades. At the same time the scarcity has made CryptoPunks an almost untouchable market for the layman. The average price for a CryptoPunk token is absorbently high due to the notoriety and combined scarcity. This is an issue that will,  at some point, limit all sought-after NFT sets.","## **The Expandable**","Another implementation of the limited nature of NFT and cryptocurrency sets is the growth-over-time model. This is most notably seen in the Bitcoin market. Bitcoin acts in an inflationary way, as community members can mine new Bitcoins. Token mining allows the set to scale over time, enabling new members to jump into the marketplace before all 21 million Bitcoins are released. All Bitcoins will be mined in roughly 120 years. Part of the policy\u2019s aim is to balance scarcity with new demand, in order to curb rapid fluctuations and monopolies.","## **The Infinite**","Most current mainstream cryptocurrencies have a planned maximum set. Very few, such as $NEO, are potentially infinite. This can be achieved by never setting a limit to new tokens being mined. As long as the ability to mine tokens exists, community members will assist the network\u2019s function. This sets up the hypothesis that once all tokens from a set are created, the market will enter a highly unpredictable state.","No current mainstream currency is both able to maintain a finite set of whole tokens and infinitely divisible. For Bitcoin specifically, the smallest possible unit is 0.00000001 BTC, called a \u201cSatoshi.\u201d At time of writing, one Satoshi is roughly 0.02 cents. By being unable to divide further, this creates a wealth floor, removing the fair representation of goods under that amount. This will only get worse as the value increases, which possibly prevents some people from being able to partake in the crypto revolution.","## **The Live**","NTFs have also been created to reflect ownership of \u201clive\u201d or real world goods. A prominent example of this phenomenon is Nike securing a patent to list shoe ownership in token form. This public ownership ledger could help them ensure the authenticity of sold/traded shoes. While an excellent idea, this fundamentally sets these tokens apart from other NFTs. Tying NFTs to live assets from shoe ownership to concert tickets puts a fundamental floor on the value of the NFT. This floor is seen as the value of the item before being posted to an NFT ledger. This value may change due to transactional costs such as shipping, material scarcity, labor, or other hastles. Not only does this set a potential value floor, but it creates a value ceiling as well. The maximum value of any live NFT can be seen as the maximum cost to secure and insure the longevity of the asset. If the live asset is destroyed yet traded, it is no different from other non-live assets. For these reasons, live NFT trading is fundamentally flawed as an economic model and does not utilize the full potential of a digital economy."]),t.i)
C.yE=H.b(s(["# **Novel Concepts**","## **A Finite Infinity**","Creating an asset, or set, which has a known total value but is infinitely divisible, was infeasible until the digital era. Most physical currencies only have about 20 value units consisting of cash and coins, allowing for simple, countable transactions among a general population. With the assistance of computers, we can ignore the need for easily identifiable units and focus on the agreed value of the transaction as a unit in itself. This method is how electronic (cashless) payments have been working for years. Even they, however, have a minimum divisible unit often set by a physical payment system.","One way to conceptualize this is to reconceptualize this new economic model as an economy based around a single dollar. If you take that dollar and divide it in half, you now have 2 tokens adding up to the total original value. To take this further, this imaginary dollar can be repeatedly divided into infinite parts and reassembled without adding or losing any parts. Most importantly to this is that there will never be any more than one dollar. It is up to the community to assign value to the set and decide how far they need to divide the parts.","## **The New Infinite**","There are more numbers between 0 and 1 than there are total integers. Both sets are infinite but creating a currency with growth built in will act in an inflationary manner over time. Creating a currency with a set known maximum yet maintaining infinite growth could provide more long term stability while still enabling it to serve any population. This is unlike any currency in existence.","Any finite asset will eventually be lost to entropy. This is mainly due to people losing access to their assets or passing on without relinquishing access to the held tokens. It is estimated that 25-30% of Bitcoin is currently inaccessible for these reasons. The process of losing access to tokens will increase the value of the remaining set to a highly restrictive amount due to scarcity. Using an infinite currency is the only way to avoid this setback.","Creating a currency that is infinitely divisible allows for all assets, no matter how low in value, to be traded. This principle also keeps deflationary scarcity tactics such as money hoarding from affecting the currencies value on a large scale. With this economic tactic a single currency can continue to represent a population as a whole even with an equally infinite population or growing wealth inequality.","## **The New Finite**","Even with an infinite set, there are still methods to create demand and scarcity. Imagine a fractal. As it is subdivided it still maintains its original form (see images). If you take this image and apply a linear gradient over it, the form and repeatability remain the same but now each pixel or region has a unique color value. This allows the holder of that subset region to know exactly which region they hold but without innately changing any aspect of the token; size, intrinsic value, or otherwise. This combines the fungible nature of cryptocurrencies with the uniqueness of NFTs.","A currency with these features would allow the community to trade tokens with value assigned from either the fungible fraction value or the unique position attribute. By combining both these qualities the possibilities of how the community will interact with and assign value are immense. We can further set assets to the currency to enable more controlled and interesting attributes.","## **Deconstruction and Reconstruction**","As the assets are infinitely divisible they must also be able to be recombined in order to curb inflationary behaviours. A few extra rules can be set in place to disincentivize divisions while still allowing for their existence.","If any token can be broken down but only \u201cagencent\u201d tokens - those with unique values sequential to each other - can be reassembled into larger tokens, it would encourage the community to assess value off of both the fungible and non-fungible aspects. If community members are looking to grow their sets, they have to look at transactions based not only on the perceived value of the tokens but the unique value of the token\u2019s agencentcy to the tokens they already hold.","This may enable many unique features to the currency\u2019s community, such as groups looking to only trade for tokens in specific regions of the set, thus looking to increase their chances of being able to build back their divided tokens. This allows for the idea of currency subsets within the single currency. These communities can grow to represent a subset of the currency\u2019s range without changing any of the initial aspects and functionality of the currency. Just like a fractal, the initial principles and design are reflected in any subset.","There is a real need to encourage the use of larger tokens as well. Many smaller tokens will inevitably take more energy to register and reconcile transactions with than one large token. By charging a small transaction fee on the per-token basis, the system can largely incentivise the use of whole tokens.","","# **Conclusion**","Creating an economy around an infinitely divisible and non-growing set enables many unique features we cannot achieve with any current economic systems. An infinite currency will enable its utility to expand far into the future, adapt to a population of any size, and set tradable value to even the smallest of items.","These tokens combine the best attributes of modern cryptocurrency trading with the unique collectibility of NFTs.","By creating a method and incentive to recombine held currency into larger assets, the currency\u2019s integrity can be preserved. In addition, opportunities will be created to find various methods of assigning value.","There is no way of knowing how a currency like this will truly behave once created, but it is the best way to ensure the longevity of a system far beyond our current imagination."]),t.i)
